Episode Title: &quot;Emergency Move-Out; Stolen Shotgun?&quot;
Episode Order: Season 18, Episode 98
Original Air Date: December 13, 2013

&quot;Former roommates feud over property, a security deposit, hotel costs and a restraining order; a pawnshop owner sues a man for pawning a stolen shotgun, which was later confiscated by the police.&quot;

Seed and enjoy!
